import React from "react";
import { useEffect, useState } from "react";
import { options } from "../options";

const Lastmatcheng = () => {
  const [data, setData] = useState([1, 2, 3]);
  const dataArray = Object.values(data[0]);
  const zadnjaData = dataArray[3];

  useEffect(() => {
    async function loadApi() {
      const response = await fetch(
        "https://football98.p.rapidapi.com/premierleague/results",
        options
      );
      response.json().then((json) => {
        setData(json);
        console.log(data);
      });
    }
    loadApi();
  }, []);
  console.log(zadnjaData);

  return (
    <div className="text-white shadow-xl top-0 w-[500px] h-[450px] bg-white">
      <div className="w-full h-[10%] flex justify-center text-black">
        <h1>Lastest Premier League Matches</h1>
      </div>
      {zadnjaData.map((item) => {
        return (
          <div className="w-full h-[8.5%] text-black flex justify-center">
            <img src={item.homeLogo} className="h-[25px] pr-4" />
            <h1>
              {item.homeTeam} {item.homeTeamScore}:{item.awayTeamScore}{" "}
              {item.awayTeam}
            </h1>
            <img src={item.awayLogo} className="h-[25px] pl-4" />
          </div>
        );
      })}
    </div>
  );
};

export default Lastmatcheng;
